import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link>Home</Link>
        </li>
        <li>Animals</li>
        {/* <li>User Photo Upload</li> */}
        <li>Resources</li>
        {/* <li>Register</li>
        <li>Login</li>
        <li>Logout</li> */}
      </ul>
    </nav>
  );
};

export default Navbar;
